import { getUserList } from '../../../api/admin/user.js';
import { getReceiptPage, deleteObj, receiptMigration } from '../../../api/apply/receipt.js';
// import {getUserInfo} from "../../../api/admin/user.js";
import { mapGetters } from 'vuex';
export default {
    data() {
        return {
            query: {
                userId: null,
                status: '',
                current: 1,
                size: 10
            },
            statusOptions: [
                {
                    value: '',
                    label: '全部'
                },
                {
                    value: '0',
                    label: '审批中'
                },
                {
                    value: '1',
                    label: '同意'
                },
                {
                    value: '2',
                    label: '拒绝'
                }
            ],
            pages: 0,
            total: 0,
            listLoading: false,
            list: [],
            number: '',
            listType: '1',
            userOptions: [],
            disabled: false
        };
    },
    created() {
        window.localStorage.removeItem('editReceiptInfo');
        this.query.status = this.$route.query.status;
        if (!this.query.status) {
            this.query.status = '';
        }
        if (this.userId != 1) {
            this.disabled = true;
        }
        this.query.userId = this.userId;
        this.getReceiptPage();
        this.getUserList();
    },
    computed: {
        ...mapGetters(['permissions', 'userId'])
    },
    methods: {
        getReceiptPage() {
            this.listLoading = true;
            getReceiptPage(this.query)
                .then(response => {
                    this.listLoading = false;
                    this.total = response.data.data.total;
                    this.query.current = response.data.data.current;
                    this.query.size = response.data.data.size;
                    this.list = response.data.data.records;
                    console.log(this.list);
                })
                .catch(() => {
                    this.listLoading = false;
                });
        },
        getUserList() {
            getUserList().then(response => {
                console.log(response);
                response.data.data.forEach(element => {
                    //console.log(element)
                    this.userOptions.push({
                        value: element.userId,
                        label: element.username
                    });
                });
            });
        },
        handleSizeChange(val) {
            this.query.size = val;
            this.getReceiptPage();
        },
        handleCurrentChange(val) {
            this.query.current = val;
            this.getReceiptPage();
        },
        handleModal(data) {
            window.localStorage.setItem('editReceiptInfo', JSON.stringify(data));
            this.$router.push({
                path: '/apply/receipt/form'
            });
        },
        handleInfo(data) {
            window.localStorage.setItem('editReceiptInfo', JSON.stringify(data));
            console.log(data);
            this.$router.push({
                path: '/apply/receipt/info/' + data.receiptId
            });
        },
        handleDel(index, row) {
            console.log(row);
            if (row.receiptId) {
                debugger;
                this.$confirm('确认删除吗?', '提示', {
                    type: 'warning'
                }).then(() => {
                    deleteObj(row.receiptId).then(res => {
                        if (res.data.data) {
                            console.log(res);
                            this.getReceiptPage();
                        }
                    });
                });
            }
        },
        openList(val) {
            if (val == 2) {
                this.$router.push({
                    path: '/apply/receipt/approver'
                });
            }
        },
        getReceiptMigration() {
            receiptMigration().then(response => {});
        }
    },
    mounted() {}
};
